import React from "react";
import {toolBarMixin} from '../StyledComponents/Library/mixins'
import styled from 'styled-components'

const Div = styled.div`
background-color: palevioletred;
color: white;
${toolBarMixin(10, 10, null, null)}
`



const App = () => {
  return (
    <div style={{height: 1000, width: 1000}}>
      <Div>Testing!</Div>
    </div>
  );
};



export default App;
